	<style>
		html,body {
    margin:0;
    padding:0;
    overflow: hidden;
}
.content {
    width: 100%;
    height: 100%;
    top:0;
    z-index: -1; 
    position: absolute;
}


.content img {
    display: block;
    outline: none;
    border:0;
    height: 100%;
    width: 100%;
}
#canvas{
	position: absolute;
	top: 72%;
	left: 0%;
	
	z-index: 10;
}

	<script type="text/javascript">
		function dateFormat(fmt, date) {
			var o = {
				"M+": date.getMonth() + 1, //月份   
				"d+": date.getDate(), //日   
				"h+": date.getHours(), //小时   
				"m+": date.getMinutes(), //分   
				"s+": date.getSeconds(), //秒   
				"q+": Math.floor((date.getMonth() + 3) / 3), //季度   
				"S": date.getMilliseconds() //毫秒   
			};
			if (/(y+)/.test(fmt))
				fmt = fmt.replace(RegExp.$1, (date.getFullYear() + "").substr(4 - RegExp.$1.length));
			for (var k in o)
				if (new RegExp("(" + k + ")").test(fmt))
					fmt = fmt.replace(RegExp.$1, (RegExp.$1.length == 1) ? (o[k]) : (("00" + o[k]).substr(("" + o[k]).length)));
			return fmt;
		}


		function draw() {
		  var div1 = document.getElementById('canvas');
		  var context=div1.getContext('2d');
		  // 设置字体
		  context.font = "4rem bold 黑体";
		  // 设置颜色
		  context.fillStyle = "rgb(10,50,137)";
		  // 设置水平对齐方式
		  context.textAlign = "center";
		  // 设置垂直对齐方式
		  context.textBaseline = "middle";
		  
		  var time=dateFormat('hh:mm:ss',new Date());
		  context.clearRect(0,0,div1.width,div1.height);  
		  context.fillText(time,180, 60,1024);
		};
		
		setInterval("draw()",1000);
	</script>
